import * as React from 'react';

import { Grid } from '@material-ui/core';

const App = () => {
  return (
    <div className="App">
      <Grid>
        Select
      </Grid>
      <Grid direction='row'>
        <Grid>
          Value 1
        </Grid>
        <Grid>
          Value 2
        </Grid>
        <Grid>
          Value 3
        </Grid>
      </Grid>
      <Grid>
        Graph
      </Grid>
    </div>
  );
}

export default App;
